import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className= "App">
        <div className = "musicPlanyer"></div>
        {songScroller()}
    </div>
  );
}

function songScroller() {
    const songList = [
        {id : 0, label: "Song 0\nArtist 0"},
        {id : 1, label: "Song 1\nArtist 1"},
        {id : 2, label: "Song 2\nArtist 2"},
    ];
    return (
        <div className="SongScroller">
        {songList.map((button) => (
            <button className={"songButton"} key = {button.id} onClick = {() => alert(`Clicked ${button.label}`)}>
                {button.label}
            </button>
            ))}
        </div>
    );
}
export default App;
